import React from 'react';
import './App.css';
import Cube from './elements/Cube';
import Left from './elements/Left';

function App() {
  return (
    <div className="App">
      <Cube/>
      <Left/>
      <Center/>
      <Right/>
    </div>
  );
}

export default App;
